import React from "react";
import './shop.css';

const Shop = () => {
    const items = [
        { src: "/combotsee2.jpg", alt: "combo", name: "Combo Tee", price: "R340" },
        { src: "/combotsee1.jpg", alt: "combo", name: "Combo Tee", price: "R225" },
        { src: "/goat2.jpg", alt: "goat-tees", name: "Goat Tee", price: "R330" },
        { src: "/goat.jpg", alt: "goat-tees", name: "Goat Tee", price: "R300" },
        { src: "/Airfoce.jpeg", alt: "nike shoe", name: "Nike Airforce", price: "R2100" },
        { src: "/air2.jpeg", alt: "nike shoe", name: "Nike Airforce", price: "R2400" },
        { src: "/oppp.jpg", alt: "Op", name: "Op Shirt", price: "R200" },
        { src: "/sama.jpg", alt: "samatha", name: "Body", price: "R200" },
        { src: "/sama2.jpg", alt: "samatha", name: "Samantha Cream", price: "250" },
    ];

    return (
        <div className="shops">
            <div className="shop-intro">
                <h2>Start Shopping Now</h2>
            </div>

            <div className="items">
                {items.map((item, index) => (
                    <div className="item" key={index}>
                        <img src={item.src} alt={item.alt} />
                        <div className="item-info">
                            <p className="item-name">{item.name}</p>
                            <p className="item-price">{item.price}</p>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default Shop;
